import React, { Component } from "react";
import {
  withGoogleMap,
  GoogleMap,
  Marker,
  MarkerProps,
  InfoWindow,
} from "react-google-maps";

export default class Mappa extends Component {
  render() {
    <Map google={this.props.google} zoom={14}>
      <Marker onClick={this.onMarkerClick} name={"Current location"} />
    </Map>;
  }
}
